changes\\n\\n`(notespace.api/listen)` will tell Notespace to listen to changes in the file corresponding to the current namespace (on a file save). When changes occur, (notespace.api/eval-and-realize-notes-from-change) is called. This results in an [Oz](https://github.com/metasoarous/oz)-like live-reload experience.\\n\\n`(notespace.api/unlisten)` will tell Notespace to stop listening to the current namespace.\"]], \"742\" [:div nil nil [:p/markdown \"We can ask for a tests summary:\"]], \"743\" [:div [:p/code {:code \"^kind/hiccup\\n(notespace/midje-summary)\", :bg-class \"bg-light\"}] nil [:div [:div \"Tests summary:\" [:div [:big [:big {:style {:color \"darkgreen\"}} \"✓\"]] \": \" 1]]]], \"715\" [:div [:p/code {:code \"^kind/dataset-grid\\n[{:a 1 :b 4}\\n {:a 2 :b 5}\\n {:a 3 :b 6}]\", :bg-class \"bg-light\"}] nil [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"a\", :field \"a\"} {:headerName \"b\", :field \"b\"}], :rowData ({\"a\" 1, \"b\" 4} {\"a\" 2, \"b\" 5} {\"a\" 3, \"b\" 6})}]]], \"701\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/code \\\"def abcd(x):\\n  return x+9\\\"\\n {:language :python}]\", :bg-class \"bg-light\"}] nil [:p/code \"def abcd(x):\\n  return x+9\" {:language :python}]], \"689\" [:div nil nil [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]], \"737\" [:div nil nil [:p/markdown \"An example of properly annotated form with a variable that resolves to a keyword which is attached to a kind->behavior method:\"]], \"663\" [:div nil nil [:p/markdown \"### Atoms\"]], \"736\" [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"(0.49034247301056444\\n 0.9093981254752153\\n 0.5779549182527514\\n 0.9194746456827535\\n 0.8316822869118164\\n 0.4021951323127261\\n 0.21442680401530612\\n 0.3558887121141443\\n 0.7655137543307241)\\n\"}]], \"644\" [:div nil nil [:p/markdown \"## References\\n\\nClojure references such as delays, futures, promises and atoms are handled by Notespace in a special way. Below we will see how Notespace offers ways to bring the dynamic REPL experience of such constructs to the dynamic browser view.\\n\\n### The rule of rendering\\n\\nAssume that a note's evaluation result `x` is a reference.\\n\\nIf `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. In the rendering value, this is marked by `(dereferenced)`.\\n\\nOtherwise, you should see a mark that says it is still pending.\\n\\n\\nFor example:\"]], \"661\" [:div nil nil [:p/markdown \"If a note's value is a future, then Notespace will be informed when that future is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example, the following note should render after two seconds (of waiting for `x` to be realized).\"]], \"700\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/code \\\"(defn abcd [x] (+ x 9))\\\"]\", :bg-class \"bg-light\"}] nil [:p/code \"(defn abcd [x] (+ x 9))\"]], \"738\" [:div [:p/code {:code \"^just-code\\n[:div \\\"just some code\\\"]\", :bg-class \"bg-light\"}] nil nil], \"732\" [:div [:p/code {:code \"(-> {:description \\\"A simple bar chart with embedded data.\\\"\\n     :data        {:values [\\n                            {:a \\\"A\\\" :b 28} {:a \\\"B\\\" :b 55} {:a \\\"C\\\" :b 43}\\n                            {:a \\\"D\\\" :b 91} {:a \\\"E\\\" :b 81} {:a \\\"F\\\" :b 53}\\n                            {:a \\\"G\\\" :b 19} {:a \\\"H\\\" :b 87} {:a \\\"I\\\" :b 52}\\n                            ]}\\n     :mark        :bar\\n     :encoding    {:x {:field :a :type :nominal :axis {:labelAngle 0}}\\n                   :y {:field :b :type :quantitative}}}\\n    (kind/override kind/vega))\", :bg-class \"bg-light\"}] nil [:p/vega {:description \"A simple bar chart with embedded data.\", :data {:values [{:a \"A\", :b 28} {:a \"B\", :b 55} {:a \"C\", :b 43} {:a \"D\", :b 91} {:a \"E\", :b 81} {:a \"F\", :b 53} {:a \"G\", :b 19} {:a \"H\", :b 87} {:a \"I\", :b 52}]}, :mark :bar, :encoding {:x {:field :a, :type :nominal, :axis {:labelAngle 0}}, :y {:field :b, :type :quantitative}}}]], \"643\" [:div nil nil [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]], \"705\" [:div nil nil [:p/markdown \"### math\"]], \"684\" [:div nil nil [:p/markdown \"* a\\n* b\\n* c\\n* d\"]], \"714\" [:div nil nil [:p/markdown \"--------------------\"]], \"712\" [:div nil nil [:p/markdown \"--------------------\"]], \"656\" [:div nil nil [:p/markdown \"### Delays\"]], \"658\" [:div [:p/code {:code \"(delay (+ 1 2))\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]] nil], \"716\" [:div nil nil [:p/markdown \"--------------------\"]], \"727\" [:div nil nil [:p/markdown \"## Progress logging\\n\\nThis should be documented better soon.\"]], \"740\" [:div [:p/code {:code \"(require '[midje.sweet :refer [fact]])\", :bg-class \"bg-light\"}] nil nil], \"687\" [:div nil nil [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]], \"639\" [:div nil nil [:p/markdown \"## Notes\\n\\nHere is a note:\"]], \"741\" [:div [:p/code {:code \"(fact\\n (+ 1 2) => 3)\", :bg-class \"bg-light\"}] nil [:div [:big [:big {:style {:color \"darkgreen\"}} \"✓\"]] \"   true\"]], \"645\" [:div [:p/code {:code \"(def d1 (delay 11))\", :bg-class \"bg-light\"}] nil nil], \"706\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/math\\n \\\"(ax ^2 + bx + c = 0 )\\\"]\", :bg-class \"bg-light\"}] nil [:p/math \"(ax ^2 + bx + c = 0 )\"]], \"686\" [:div [:p/code {:code \"^kind/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] nil [:big [:big 3]]], \"703\" [:div [:p/code {:code \"^kind/code\\n[\\\"(defn abcd [x] (+ x 9))\\\"\\n \\\"(defn abcd [x] (+ x 3))\\\"]\", :bg-class \"bg-light\"}] nil [:div [:p/code \"(defn abcd [x] (+ x 9))\"] [:p/code \"(defn abcd [x] (+ x 3))\"]]], \"659\" [:div nil nil [:p/markdown \"If you have called `notespace.api/eval-and-realize-note-at-line` with the line holding this note, or `notespace.api/eval-and-realize-this-notespace` with this notespace, then you should see the number 3 there. Otherwise, you should see a mark that says it is still pending.\"]], \"637\" [:div nil nil nil], \"668\" [:div [:p/code {:code \"^kind/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] nil nil], \"654\" [:div nil nil [:p/markdown \"#### eval-and-realize-notes-from-change\\n\\n Use `notespace.api/eval-and-realize-notes-from-change` to evaluate and realize all notes starting from the line where the file has changed in its last save, compared to the previous save.\"]], \"678\" [:div nil nil [:p/markdown \"### hidden\\n\\nA `:hidden` note does not render its value, and also does not show its code.\\n\\nHere is a note that you cannot see:\"]], \"680\" [:div nil nil [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]], \"666\" [:div [:p/code {:code \"a\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"{:x 3}\\n\"}]], \"721\" [:div nil nil [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]], \"648\" [:div [:p/code {:code \"d1\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]] nil], \"720\" [:div [:p/code {:code \"[:hiccup [:big [:big 3]]]\", :bg-class \"bg-light\"}] nil [:hiccup [:big [:big 3]]]], \"652\" [:div nil nil [:p/markdown \"#### eval-and-realize-note-at-line\\n\\nUse `notespace.api/eval-and-realize-note-at-line` to evaluate the note at a certain line, realize the value if it is an unrealized derefable value, and inform Notespace about the result.\\n\\nFor example, `(notespace.api/eval-and-realize-note-at-line 14)` applies that to the note at line 14.\"]], \"718\" [:div [:p/code {:code \"^kind/html\\n(str \\\"<h4>h4</h4>\\\"\\n     \\\"<h5>h5</h5>\\\")\", :bg-class \"bg-light\"}] nil [:p/html \"<h4>h4</h4><h5>h5</h5>\"]], \"726\" [:div nil nil [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]], \"685\" [:div nil nil [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]], \"651\" [:div nil nil [:p/markdown \"#### eval-and-realize-this-notespace\\n\\nUse `notespace.api/eval-and-realize-this-notespace` to evaluate all notes in the current namespace sequentially, one note after another, and then realize them in the background. As always, Notespace is informed about the results.\"]], \"697\" [:div [:p/code {:code \"^kind/vega\\n{\\n  :description \\\"A simple bar chart with embedded data.\\\"\\n  :data {\\n    :values [\\n      {:a \\\"A\\\" :b 28} {:a \\\"B\\\" :b 55} {:a \\\"C\\\" :b 43}\\n      {:a \\\"D\\\" :b 91} {:a \\\"E\\\" :b 81} {:a \\\"F\\\" :b 53}\\n      {:a \\\"G\\\" :b 19} {:a \\\"H\\\" :b 87} {:a \\\"I\\\" :b 52}\\n    ]\\n  }\\n  :mark :bar\\n  :encoding {\\n    :x {:field :a :type :nominal :axis {:labelAngle 0}}\\n    :y {:field :b :type :quantitative}\\n  }\\n}\", :bg-class \"bg-light\"}] nil [:p/vega {:description \"A simple bar chart with embedded data.\", :data {:values [{:a \"A\", :b 28} {:a \"B\", :b 55} {:a \"C\", :b 43} {:a \"D\", :b 91} {:a \"E\", :b 81} {:a \"F\", :b 53} {:a \"G\", :b 19} {:a \"H\", :b 87} {:a \"I\", :b 52}]}, :mark :bar, :encoding {:x {:field :a, :type :nominal, :axis {:labelAngle 0}}, :y {:field :b, :type :quantitative}}}]], \"725\" [:div nil nil [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]], \"702\" [:div nil nil [:p/markdown \"Such tags can usually be handled through dedicated kinds too.\"]], \"710\" [:div nil nil [:p/markdown \"### dataset-grid\\n\\nNotes of kind `:dataset-grid` are expecting a value which is one of the following:\\n- a map, whose values are same-length sequentials (one example of such a map is a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries);\\n- a sequence of maps.\\n\\nThey render that values as an [ag-Grid](https://www.ag-grid.com/) table view.\\n\\nFor example:\"]], \"653\" [:div nil nil [:p/markdown \"#### eval-and-realize-notes-from-line\\n\\nUse `notespace.api/eval-and-realize-notes-from-line` to evaluate and realize all notes starting from a certain line, and inform Notespace.\"]], \"642\" [:div nil nil [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Notespace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]], \"730\" [:div [:p/code {:code \"(-> [:div [:big [:big 3]]]\\n    (kind/override kind/hiccup))\", :bg-class \"bg-light\"}] nil [:div [:big [:big 3]]]], \"640\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] nil [:p/code {:code \"21\\n\"}]], \"694\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] nil [:p/player {:width \"100%\", :height \"100%\", :url \"https://www.youtube.com/watch?v=G512fvK9KXA\"}]], \"693\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/leafletmap\\n    {:tile-layer leaflet-providers/Stamen-TonerLite}\\n    [{:type   :view\\n      :center [51.49, -0.08]\\n      :zoom   12\\n      :height 600\\n      :width  700}\\n     {:type   :rectangle\\n      :bounds [[51.49, -0.08]\\n               [51.5, -0.06]]}\\n     {:type      :circle\\n      :center    [51.505, -0.09]\\n      :fillColor :blue\\n      :radius    200}\\n     {:type      :polygon\\n      :positions [[51.515, -0.09]\\n                  [51.52, -0.1]\\n                  [51.52, -0.12]]\\n      :color     :purple}\\n     {:type      :polygon\\n      :positions [[[51.51, -0.12]\\n                   [51.51, -0.13]\\n                   [51.53, -0.13]]\\n                  [[51.51, -0.05]\\n                   [51.51, -0.07]\\n                   [51.53, -0.07]]]\\n      :color     :purple}\\n     {:type      :line\\n      :positions [[51.505, -0.09]\\n                  [51.51, -0.1]\\n                  [51.51, -0.12]]\\n      :color     :lime}\\n     {:type      :line\\n      :positions [[[51.5, -0.1]\\n
